import Topbar from "./topbar";
import LogoIcon from "../../icons/logo";
import HeartIcon from "../../icons/heart";
import CartIcon from "../../icons/cart";
import SearchIcon from "../../icons/search";

function Header() {
  const design = {
    container: "border",
    inputwrapper: "",
    input: "outline-none",
  };
  const position = {
    container: "flex justify-between px-5 py-2 items-center",
    wrapper: "flex gap-4",
    inputwrapper: "flex",
  };

  return (
    <>
      <Topbar />
      <div className={`${design.container} ${position.container}`}>
        <LogoIcon />
        <div className={position.wrapper}>
          <p>Men</p>
          <p>Women</p>
          <div className={`${position.inputwrapper} ${design.inputwrapper}`}>
            <SearchIcon />
            <input className={design.wrapper} placeholder="Search" />
          </div>
          <HeartIcon />
          <CartIcon />
        </div>
      </div>
    </>
  );
}

export default Header;
